export const toggleFilter = filter => ({
    type: 'TOGGLE_FILTER',
    filter
});

export const VisibilityFilters = {
    NECKLACE: 'NECKLACE',
    BRACELET: 'BRACELET',
    EARRINGS: 'EARRINGS'
};
